import img_facebook from "../../img/facebook.svg";
import img_vk from "../../img/VK Logo White.svg";
import RoundKnob from "../RoundKnob/RoundKnob.js";

function FB_VK() {
  return (
    <div className="fc_vk">
      <RoundKnob url="https://www.facebook.com/denis.chigvintsev/">
        <img className="facebook" src={img_facebook} />
      </RoundKnob>
      <pre> </pre>
      <RoundKnob url="https://vk.com/den_dennie">
        <img className="facebook" src={img_vk} />
      </RoundKnob>
    </div>
  );
}

export default FB_VK;
